import Link from 'next/link';
import Head from 'next/head';
import Layout from './layout'

const Index = () => (
	<Layout>
		<div className="py-5 position-absolute" style={{top:'45%', left: '45%'}}>
			<div className="text-center">
				<h1 className="font-weight-bold text-prmary">Weather Finder</h1>
			</div>
		</div>
	</Layout>
)

export default Index;
